function Main({ firebase }) {
  const [events, setEvents] = useState([]);
  useEffect(() => {
    const fetchData = async () => {
      const events = await loadEvents({ pageUnit: 10 });
      setEvents(mapEvents(events.items));
    };
    fetchData();
  }, [firebase]);

  return (
    <div className="Main">
      <div className="movie-bg"/>
      <HeroEvents/>
      <div className="location-slick">
        <CircleItemSlider slickItems={temp}/>
      </div>
      <div className="all-event-list">
        {events.map(event => <GroupPerDay key={event.date} {...event} />)}
      </div>
    </div>
  )
}

export default Main;
